import React from 'react';
import { Link } from 'react-router-dom';

import './Home.css'

function Home(props) {
  return (
    <div className="home">
      <h1 className="heading">emily lobel</h1>
      <h2 className="welcome">hi :)</h2>
      <p className="iam">i am a <Link to="/engineer" className="engineer">software engineer</Link>
      </p>
      <p className="iam">i am also an <Link to="/actor" className="actor"> actor</Link>
      </p>
    </div>
  );
}

export default Home;
